import Home from './components/Home';
import Ecommerce from './pages/EcommerceWebsite/components/Ecommerce';
import { Routes, Route } from 'react-router-dom'
import { Container } from 'react-bootstrap'
import Collection from './pages/EcommerceWebsite/components/Collection';
import NewArrivals from './pages/EcommerceWebsite/components/NewArrivals';

function App() {
  return (
    <Container>
      <Routes>
        <Route path='/' element={<Home />}></Route>
        {/* home for ecommerce page */}
        <Route path='ecommerce' element={<Ecommerce />}>
          <Route path='collections' element={<Collection />}>
            <Route path='new-arrivals' element={<NewArrivals />}></Route>
            <Route path='house-home' element={<Ecommerce />}></Route>
            <Route path='kitchen' element={<Ecommerce />}></Route>
            <Route path='office' element={<Ecommerce />}></Route>
            <Route path='personal-goods' element={<Ecommerce />}></Route>
          </Route>
        </Route>
        <Route path='*' element={<div>Error 404</div>}></Route>
      </Routes>
    </Container>
  );
}

export default App;
